import { Card} from "react-bootstrap";
import './PortraitCard.css'
const PortraitCard = () => {
    return (
        <Card className='card-custom'>
            <div className='card-imgs'>
                <Card.Img className='imgs' variant="top" src="art.jpg" />
            </div>
            <Card.Body>
                <h4>raja</h4>
                <Card.Title className='txt'>Card title</Card.Title>
                <Card.Text className="txt">Lorem Epsum</Card.Text>
                <div> <p className='txt'>Lorem ipsum</p></div>
            </Card.Body>
        </Card>
    );
}

export default PortraitCard
